import React from "react";
import { Link } from "react-router-dom";
import { NavbarData } from "./Navbar-data";
import "./Navbar.scss";

function Navbar() {
  return (
    <header>
      <Link to="/" className="logo">
        Mantul <span>.</span>
      </Link>
      <nav>
        {NavbarData.map((yo, index) => {
          return (
            <Link key={index} to={yo.to}>
              {yo.title}
            </Link>
          );
        })}
      </nav>

      <div className="sing">
        <Link to="/sing-up">Sing Up</Link>
        <Link className="sing-btn" to="/sing-in">Sing In</Link>
      </div>
    </header>
  );
}

export default Navbar;
